import React, { useState } from "react";
import axios from "axios";

function RoomList() {
  const [rooms, setRooms] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Date Inputs
  const [check_in_date, setcheck_in_date] = useState("");
  const [check_out_date, setcheck_out_date] = useState("");

  // Filters
  const [priceRange, setPriceRange] = useState([0, 1000]);
  const [roomType, setRoomType] = useState("");

  const fetchRooms = async () => {
    if (!check_in_date || !check_out_date) {
      setError("Please select both check-in and check-out dates.");
      return;
    }

    setLoading(true);
    setError(null);
    try {
      const response = await axios.get("http://localhost:5000/api/rooms", {
        params: {
          check_in_date,
          check_out_date,
          minPrice: priceRange[0],
          maxPrice: priceRange[1],
          roomType: roomType || undefined, // Don't send if empty
        },
        headers: {
          Authorization: `Bearer ${token}`, // Add your token here
        },
      });
      setRooms(response.data);
    } catch (err) {
      console.error("Error fetching rooms:", err);
      setError("Failed to load rooms.");
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <div>Loading rooms...</div>;
  if (error) return <div style={{ color: "red" }}>{error}</div>;

  return (
    <div>
      <h2>Available Rooms</h2>

      {/* Date Inputs */}
      <div>
        <label>Check-In Date:</label>
        <input
          type="date"
          value={check_in_date}
          onChange={(e) => setcheck_in_date(e.target.value)}
        />
        <br />
        <label>Check-Out Date:</label>
        <input
          type="date"
          value={check_out_date}
          onChange={(e) => setcheck_out_date(e.target.value)}
        />
        <br />
      </div>
      <br />
      {/* Price Range Filter */}
      <div>
        <label>Price Range:</label>
        <br />
        Min: 
        <input
          type="number"
          value={priceRange[0]}
          min="0"
          onChange={(e) => setPriceRange([+e.target.value, priceRange[1]])}
        />
        <br />
        Max:
        <input
          type="number"
          value={priceRange[1]}
          min={priceRange[0]}
          onChange={(e) => setPriceRange([priceRange[0], +e.target.value])}
        />
        <br />
      </div>
      <br />
      {/* Room Type Filter */}
      <div>
        <label>Room Type:</label>
        <select value={roomType} onChange={(e) => setRoomType(e.target.value)}>
          <option value="">All</option>
          <option value="Single">Single</option>
          <option value="Double">Double</option>
          <option value="Suite">Suite</option>
        </select>
      </div>
      <br />
      <button onClick={fetchRooms}>Search</button>

      {/* Room List */}
      {rooms.length === 0 ? (
        <p>No available rooms for the selected dates and filters.</p>
      ) : (
        <ul>
          {rooms.map((room) => (
            <li key={room.number}>
              <strong>{room.type}</strong>: ${room.price} per night
              <br />
              Description: {room.description}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default RoomList;
